const Hello = (props) => {
  return (
    <div>
      <p>Hello Alllll</p>
    </div>
  )
}

const Footer = () => {
  return (
    <div>
      <p>Hello I'm footer</p>
    </div>
  )
}

const App = () => {
  const name = 'Peter'
  const age = 10

  return (
    <div>
      <h1>Greetings</h1>,
      <Hello name='Maya' age={26 + 10} />,
      <Hello name={name} age={age} />,
      <Footer />
    </div>
  )
}

export default App;
